webpackJsonp([1397],{"./node_modules/json-loader/index.js!./.cache/json/articles-javascript-standard-objects-array-array-prototype-unshift.json":function(e,r){e.exports={data:{markdownRemark:{html:'<p>The JavaScript array method <code>.unshift()</code> adds one or more elements to the beginning of an array and returns the new length of the array.</p>\n<p><strong>Syntax</strong></p>\n<pre><code>arr.unshift([element1[, ...[, elementN]]])\n</code></pre>\n<h2>Parameters</h2>\n<p>The elements to add to the front of the array.</p>\n<h2>Returns</h2>\n<p>The new <code>length</code> of the array upon which the method was called.</p>\n<h2>Examples</h2>\n<pre><code>var array = [1, 2, 3, 4, 5];\n\narray.unshift(0);\n// If we console.log(array.shift()); the console would output 6.\n// array is now [0, 1, 2, 3, 4, 5];\n\narray.unshift([-1]);\n// array is now [[-1], 0, 1, 2, 3, 4, 5];\n</code></pre>\n<p><img src="//forum.freecodecamp.com/images/emoji/emoji_one/rocket.png?v=2" alt=":rocket:" title=":rocket:"> <a href="https://repl.it/C2V3">Run code</a></p>\n<p>Source <a href="https://developer.mozilla.org/en/docs/Web/JavaScript/Reference/Global_Objects/Array/unshift">MDN</a></p>',frontmatter:{title:"Array.prototype.unshift",parent:"/home/stuart/guides/src/pages/articles/javascript/standard-objects/array/array-prototype-unshift/index.md absPath of file"}}},pathContext:{slug:"/articles/javascript/standard-objects/array/array-prototype-unshift/"}}}});
